import { useContext } from 'react';
import { AuthContext } from '../App';

function Checkout() {
  const { token } = useContext(AuthContext);

  return (
    <div className="py-8">
      <h2 className="text-3xl font-bold text-center text-blue-700 mb-6">Checkout</h2>
      <div className="max-w-md mx-auto bg-white p-6 rounded-lg shadow-lg text-center">
        {token ? <p className="text-gray-700">Proceed to checkout (cart logic TBD).</p> : <p className="text-red-500">Please log in to checkout.</p>}
      </div>
    </div>
  );
}

export default Checkout;
